import React, {Component} from 'react';
import Child from './Child'; 
class App extends Component{
  state={
    name:'App component',
    title:'Hello'
  }
  render(){
    return(
      <div id='root'> 
        <Child/>
        <h2>REACT</h2>
        <p>Hello React {this.state.name}</p>
      
        
      </div>
    );
  }
}



export default App;
